2782	2025-05-31 13:14:26	audit_writer	admin	172.17.0.1	class_schedule	U	{"end_tm": "12:45:00", "group_id": null, "start_tm": "11:15:00", "auditorium": "Г-504", "signal_ind": "active", "change_dttm": null, "create_dttm": "2025-05-31T10:10:23.546381", "schedule_dt": "2025-04-29", "numbers_week": "13", "professor_id": null, "class_type_id": null, "discipline_id": null, "class_schedule_id": 7}	{"end_tm": "12:45:00", "group_id": 55, "start_tm": "11:15:00", "auditorium": "Г-504", "signal_ind": "active", "change_dttm": "2025-05-31T13:14:25.697289", "create_dttm": "2025-05-31T10:10:23.546381", "schedule_dt": "2025-04-29", "numbers_week": "13", "professor_id": 149, "class_type_id": 2, "discipline_id": 6, "class_schedule_id": 7}	DO $$\r\nDECLARE\r\n    batch_size INTEGER := 100;\r\n    rows_updated INTEGER := 1;\r\n    total_updated INTEGER := 0;\r\n    random_auditorium TEXT;\r\nBEGIN\r\n    WHILE rows_updated > 0 LOOP\r\n        -- Получаем случайную аудиторию с пустыми полями\r\n        SELECT auditorium INTO random_auditorium \r\n        FROM class_schedule \r\n        WHERE (group_id IS NULL OR discipline_id IS NULL OR class_type_id IS NULL OR professor_id IS NULL)\r\n        ORDER BY random() \r\n        LIMIT 1;\r\n        \r\n        -- Выходим, если нечего обновлять\r\n        EXIT WHEN random_auditorium IS NULL;\r\n        \r\n        -- Обновляем все пустые поля для выбранной аудитории\r\n        UPDATE class_schedule\r\n        SET \r\n            group_id = COALESCE(group_id, (SELECT group_id FROM study_group ORDER BY random() LIMIT 1)),\r\n            discipline_id = COALESCE(discipline_id, (SELECT discipline_id FROM disciplines ORDER BY random() LIMIT 1)),\r\n            class_type_id = COALESCE(class_type_id, (SELECT class_type_id FROM class_types ORDER BY random() LIMIT 1)),\r\n            professor_id = COALESCE(professor_id, (SELECT user_id FROM user_info WHERE user_status = 'Преподаватель' ORDER BY random() LIMIT 1))\r\n        WHERE \r\n            auditorium = random_auditorium\r\n            AND (group_id IS NULL OR discipline_id IS NULL OR class_type_id IS NULL OR professor_id IS NULL);\r\n        \r\n        GET DIAGNOSTICS rows_updated = ROW_COUNT;\r\n        total_updated := total_updated + rows_updated;\r\n        \r\n        RAISE NOTICE 'Обновлено строк: %, аудитория: %', rows_updated, random_auditorium;\r\n        \r\n        -- Проверяем, остались ли записи для обновления\r\n        EXIT WHEN NOT EXISTS (\r\n            SELECT 1 FROM class_schedule\r\n            WHERE (group_id IS NULL OR discipline_id IS NULL OR class_type_id IS NULL OR professor_id IS NULL)\r\n        );\r\n        \r\n        COMMIT;\r\n        PERFORM pg_sleep(0.1);\r\n    END LOOP;\r\n    \r\n    RAISE NOTICE 'Обновление завершено. Всего обновлено строк: %', total_updated;\r\nEND $$
