2998	2025-05-31 13:14:46	audit_writer	admin	172.17.0.1	faculties	U	{"faculty_id": 1, "change_dttm": null, "create_dttm": "2025-05-31T10:07:53.860176", "faculty_code": "07.03.01", "faculty_name": "Архитектура", "institute_id": null}	{"faculty_id": 1, "change_dttm": "2025-05-31T13:14:46.185656", "create_dttm": "2025-05-31T10:07:53.860176", "faculty_code": "07.03.01", "faculty_name": "Архитектура", "institute_id": 1}	DO $$\r\nDECLARE\r\n    batch_size INTEGER := 100;\r\n    rows_updated INTEGER := 1;\r\n    row_ctid tid;\r\n    matched_faculty_id INTEGER;\r\nBEGIN\r\n    WHILE rows_updated > 0 LOOP\r\n        -- Обрабатываем строки пачками\r\n        FOR row_ctid IN \r\n            SELECT f.ctid\r\n            FROM faculties f\r\n            WHERE f.institute_id IS NULL\r\n            LIMIT batch_size\r\n        LOOP\r\n            -- Находим соответствующий институт для текущего факультета\r\n            SELECT i.institute_id INTO matched_faculty_id\r\n            FROM faculties f\r\n            JOIN sandbox.foreign_faculties_with_institutes ffwi ON f.faculty_name = ffwi.faculty_name\r\n            JOIN institutes i ON i.institute_name = ffwi.институт\r\n            WHERE f.ctid = row_ctid;\r\n            \r\n            -- Обновляем только если нашли соответствие\r\n            IF matched_faculty_id IS NOT NULL THEN\r\n                UPDATE faculties\r\n                SET institute_id = matched_faculty_id\r\n                WHERE ctid = row_ctid;\r\n            END IF;\r\n        END LOOP;\r\n        \r\n        GET DIAGNOSTICS rows_updated = ROW_COUNT;\r\n        RAISE NOTICE 'Обновлено строк: %', rows_updated;\r\n        \r\n        EXIT WHEN NOT EXISTS (\r\n            SELECT 1 FROM faculties\r\n            WHERE institute_id IS NULL\r\n        );\r\n        \r\n        COMMIT;\r\n        PERFORM pg_sleep(0.1);\r\n    END LOOP;\r\nEND $$
