--
-- Name: log_audit_event(); Type: FUNCTION; Schema: public; Owner: audit_writer
--

CREATE FUNCTION public.log_audit_event() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_app_user TEXT;
    v_ip INET;
    v_db_user TEXT := current_user;  -- Пользователь БД (роль с доступом)
BEGIN
    -- 1. Определяем реального пользователя приложения:
    v_app_user := COALESCE(session_user, v_db_user);
    
    -- 2. Получаем IP-адрес клиента
    BEGIN
        v_ip := inet_client_addr();
    EXCEPTION WHEN OTHERS THEN
        v_ip := NULL;
    END;
    
    -- 3. Логирование события
    IF (TG_OP = 'INSERT') THEN
            app_user,  -- Реальный пользователь приложения
            db_user,   -- Роль с доступом к функции
            ip_address,
            table_name,
            operation,
            new_data,
            query_text
        ) VALUES (
            v_app_user,
            v_db_user,
            v_ip,
            TG_TABLE_NAME,
            'I',
            to_jsonb(NEW),
            current_query()
        );
        RETURN NEW;
    
    ELSIF (TG_OP = 'UPDATE') THEN
            app_user,
            db_user,
            ip_address,
            table_name,
            operation,
            old_data,
            new_data,
            query_text
        ) VALUES (
            v_app_user,
            v_db_user,
            v_ip,
            TG_TABLE_NAME,
            'U',
            to_jsonb(OLD),
            to_jsonb(NEW),
            current_query()
        );
        RETURN NEW;
    
    ELSIF (TG_OP = 'DELETE') THEN
            app_user,
            db_user,
            ip_address,
            table_name,
            operation,
            old_data,
            query_text
        ) VALUES (
            v_app_user,
            v_db_user,
            v_ip,
            TG_TABLE_NAME,
            'D',
            to_jsonb(OLD),
            current_query()
        );
        RETURN OLD;
    END IF;
    RETURN NULL;
END;
$$;


