--
-- Name: process_auto_deletions_daily(); Type: FUNCTION; Schema: public; Owner: admin
--

CREATE FUNCTION public.process_auto_deletions_daily() RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
	BEGIN
		UPDATE users
		SET signal_ind = 'deleted',
		    change_dttm = NOW()
		WHERE auto_delete_dt <= CURRENT_DATE;
	END;
	BEGIN
		UPDATE temp_vuc_users_in_naryad
		SET signal_ind = 'deleted',
		    change_dttm = NOW()
		WHERE auto_delete_dt <= CURRENT_DATE;
	END;
END;
$$;


